import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from "./App";
import reportWebVitals from "./reportWebVitals";
import DetailPage from "./routes/detail-page";
import WhichWaterDoYouDrink from "./components/which-water-do-you-drink";
import { getWaterBrands } from "./data";

const waterBrands = getWaterBrands();
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <BrowserRouter>
    <Routes>
    <Route path='/' element={<App />}>
      {waterBrands.map((waterBrand) => (
        <Route key={waterBrand.id} path={`${waterBrand.id}`} element={<DetailPage/>}/>
      ))}
      <Route/>
    </Route>
    </Routes>
  </BrowserRouter>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
